  return (
    <div className="goals__list">
      <ul className="list">
        {props.goals.length ? (
          <Goal />
        ) : (
          <p className="list__empty">
            You have nothing to do. &#45;Add something
          </p>
        )}
      </ul>
    </div>
  );
}

export default GoalsList;
